import React from "react";
import {NextPage} from 'next';
import Layout from '../../../Nhadatmoi/components/Layout/Layout';
import Index from "../../../Nhadatmoi/components/Post/Index"
import "../../assets/scss/style.scss";
import {mainURL} from "../../../Nhadatmoi/constants";

interface PostProps {

}
const Post: NextPage<PostProps> = (prop: PostProps) => {
  let pageTitle = 'Đăng tin';
  let pageDescription = 'Tin rao của bạn sẽ được tiếp cận một lượng khách hàng lớn nhất bằng công nghệ. Đăng tin theo cách của bạn, còn lại để Nhà Đất Mới lo. Mang tới cho người mua và người bán những giao dịch kiểu mới: nhanh, chuẩn, chính xác.';
  let canonicalTagUrl = mainURL + '/dang-tin';
  return (
    <Layout
      title={pageTitle}
      description={pageDescription}
      {...prop}
      canonical={ canonicalTagUrl }
      path={''}
    >
      <Index />
    </Layout>
  );
};

export default Post;
